import React from "react";
import Header from "./header.jsx";
import Footer from "./footer.jsx";
import Note from "./note.jsx"
import notes from "./notes.js"

function App(){
    return(
        <div>
        <Header />
        {notes.map(function (notespoints){
            return(<Note
                key = {notespoints.key}
                title = {notespoints.title}
                content = {notespoints.content}

            />) 
            })
            }
            <Footer />
        </div>
         )
}
export default App ;
